import React, { Component } from "react";
import axios from "axios";

class Ambulances extends Component {
  state = {
    ambulances: [],
  };

  async componentDidMount() {
    const { data: ambulances } = await axios.get(
      "http://localhost:3900/api/ambulances"
    );
    this.setState({ ambulances });
  }

  render() {
    if (this.state.doctors.length === 0)
      return <p>There are currently no doctor available to make appointment</p>;
    return (
      <React.Fragment>
        <p>
          There are {this.state.doctors.length} doctor/s available to make
          appointment
        </p>
        <table className="table">
          <thead>
            <tr>
              <th>Ambulance Name</th>
              <th>Type</th>
              <th>Cost Per Hour</th>
              <th>Driver Name</th>
              <th></th>
            </tr>
          </thead>
          <tbody>
            {this.state.ambulances.map((ambulance) => (
              <tr>
                <td>{ambulance.name}</td>
                <td>{ambulance.type}</td>
                <td>{ambulance.cost_per_hour}</td>
                <td>{ambulance.driver.name}</td>
                <td>
                  <button
                    onClick={this.makeRequest}
                    className="btn btn-warning btn-sm"
                  >
                    Request For Service
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </React.Fragment>
    );
  }
}

export default Ambulances;
